'''
python happiest_state.py <sentiment_file> <tweet_file>

Given a sentiment file and a tweet file, tries to find which of is the happiest state of the US.
The geolocation info is parsed from three sources (ordered from reliability) within the tweet:
	- tweet['coordinates'] -- Supposed to be the most accurate one (for further info https://dev.twitter.com/docs/platform-objects/tweets#obj-coordinates)
	- tweet['place'] -- Sometimes reliable.(for further info https://dev.twitter.com/docs/platform-objects/places)
	- tweet['user']['location'] --  Very unreliable. (for further info https://dev.twitter.com/docs/platform-objects/users)
The code looks for the geolocation data in the coordinates field first, then the place field and finally the user/location
field. If it gets some data, it looks no more, since it will most certainly not find anything more accurate.


OUTPUT:
	List of states with their associated "happiness" and the happiest state, parsing the tweets
	against the sentiment file.
KNOWN WEAKNESSES:
	Since there are a lot of tweets without any geolocation data, sometimes there will be some states
	without any linked tweets. These states will be avoided. However, if a state has a very reduced
	number of linked tweets, its score is gonna be greatly biased by the few linked tweets.
'''

